岗位职责:
根据需求对整车控制功能进行测试和验收及问题反
陨;
梳理和分析需求，基于需要和闭户场果设计测试框架
和闭例;
对测试过程中的问题进行定位分析以及推动解决；
基于已有的接口实现自动化闭例。
任职要求：
a,熟悉整车功能，具备车辆控制相关测试经验,例如:
车窗、门锁、充放电、空调、数字钥匙等功能测试经
验；有车云、大数据上报等相关测试经验入
b,熟悉CAN、Lin总线，VDS协议，能够基于总线数据
分析问题;
c,熟练掌握Python编程语言;
以,熟练使用CANoe，同星等测试工具：
e，良好的跨团队协作，工作积极主动，执行力强，持
续学习，责任感强，有问题推进能力；
f,了解云端接口测试优先;
g，有车载网关测试经验优先
h，了解Linux知识，了解PyteSt自动化框架和Git、以太
网协议优先;
i,需要熟悉python和台架测试;
